import React from "react";
import  s from './Sidebar.module.css';
function Sidebar() {
    return(
    <div className={s.sidebar}>
        <ul>
            <li>News</li>
            <li>About</li>
            <li>Articles</li>
            <li>Review</li>
        </ul>
    </div>)
}
export default Sidebar;
